import React from 'react'
import { Col, Container, Row } from 'react-bootstrap'

export default function Home() {
  return (
    <div>
      <Container>
          <Row>
            <Col md={{ span: 6, offset: 3 }}>{`md={{ span: 6, offset: 3 }}`}</Col>
          </Row>
      </Container>
    </div>
  )
}
